import React from 'react';
import stuff from './stuff.png';

class Header extends React.Component{
    render(){
        return(
            <div id= "header">
            
            <img src = "./components/stuff.png" width="1000" height="200" alt="headerimage" />
            </div>
        )
    }
}

export default Header;
